import React from 'react'

const Innerlayout = ({ children, heading , subheading, ...props }) => {
  return (
    <div className="innerlayout-main">
    <div className="py-[64px] flex flex-col justify-center items-center w-full">
      <h1 className="font-bold text-[32px]">{heading}</h1>
      <p className="pt-[17px] pb-[48px] text-[16px] font-normal">
       {subheading}
      </p>
      <div className="max-w-[624px] bg-[#F3F4F6] p-[32px] w-full ">
      {children}
      </div>
    </div>
  </div>
  )
}

export default Innerlayout
